    var getStopsInBoundingBox = function (minLon, maxLon, minLat, maxLat) {
        var i, stopsInBox = [];
        for (i in stops) {
            if (minLon <= stops[i]['lon'] && maxLon >= stops[i]['lon']) {
                if (minLat <= stops[i]['lat'] && maxLat >= stops[i]['lat']) {
                    stopsInBox.push(stops[i]);
                }
            }
        }
        return stopsInBox;
    };

